// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

contract EtherUints{

    uint256 public oneWei = 1 wei;

    uint256 public oneGwei = 1 gwei;

    uint256 public oneEther = 1 ether;

    function get(uint types ) public view  returns(uint256){
        if(1==types){
            return oneGwei;
        } else if(2==types){
            return oneEther;
        }else {
            return oneWei;
        }

    }


}

